import React, {Component} from 'react';
import {Todo} from './Todo'

export class TodoList extends Component {

    render() {
        const todoList = this.props.todoList;
        const listItems = todoList.map((todo) =>
    <li key={todo}>
      {number}
    </li>
  );
        return(
            <ul>{listItems}</ul>
        );
    }
}
export default TodoList;
